import About from './components/About';



function App() {
  return (
    <>
    <Router>
    <Navbar /> 
    <Home />
    <Switch>
          <Route ecapath="/about">
            <About/>
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </Router>
    </>
  );
}


export default App;
